import Link from 'next/link';
import "../styles.scss"

const linkStyle = {
	marginRight: 15
}

export default function Header() {
	return (
		<div align='center' color='black'>
			<Link href="/">
				<a style={linkStyle} className='text'>Home</a>
			</Link>
			<Link href="/guide">
				<a style={linkStyle} className='text'>The Beginners Method</a>
			</Link>
		</div>
	)
}
